import { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function TeacherClassRegister() {
    const [subject, setSubject] = useState("");
    const [grade, setGrade] = useState("");
    const navigate = useNavigate();

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log("Đăng ký dạy:", { subject, grade });
        navigate("/"); // Sau khi đăng ký xong quay lại trang Home
    };

    return (
        <div className="p-6">
            <h1 className="text-2xl font-bold mb-4">Đăng ký dạy học</h1>
            <form onSubmit={handleSubmit} className="space-y-4">
                <div>
                    <label className="block font-medium">Môn học:</label>
                    <input
                        type="text"
                        value={subject}
                        onChange={(e) => setSubject(e.target.value)}
                        className="border p-2 w-full rounded-md"
                        required
                    />
                </div>
                <div>
                    <label className="block font-medium">Khối lớp:</label>
                    <input
                        type="text"
                        value={grade}
                        onChange={(e) => setGrade(e.target.value)}
                        className="border p-2 w-full rounded-md"
                        required
                    />
                </div>
                <button type="submit" className="bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-600">
                    Xác nhận đăng ký
                </button>
            </form>
        </div>
    );
}
